INSERT INTO `razas` (`id`, `nombre_raza`, `descripcion`) VALUES
(1, 'Affenpinscher', 'El affenpinscher es un perro toy de aspecto extravagante, original y desaliñado. No necesita mucho ejercicio ni mucho espacio para vivir. ¿Sabes qué es lo mejor de esta raza? Sin duda, su personalidad. Estos pequeños se toman a sí mismos muy en serio.'),
(2, 'Airedale Terrier', 'El airedale terrier o ‘rey de los terriers’ es el terrier más grande del mundo. Su origen se encuentra en zonas rurales del condado de York, Inglaterra. Los airedale terrier son perros grandes, fuertes, musculosos y activos que harán las delicias de los amantes del deporte.'),
(3, 'Akita Americano', 'Debido a la carestía de alimentos, durante la segunda guerra mundial, se prohibió tener Akitas en japón. Para tratar de salvar a sus perros, algunas propietarios comenzaron a cruzar sus akitas con otras razas permitidas y de ese mestizaje surgió el Akita Americano.'),
(4, 'Akita Inu', 'El Akita Inu, Akita Ken, Akita japonés o, simplemente, Akita es un perro originario de Japón. Su nombre significa “perro de Akita” y está considerado un orgullo nacional en el país del sol naciente, incluso se considera al Akita un amuleto de buena suerte.'),
(6, 'Alaskan Malamute', 'El Alaskan Malamute o Malamute de Alaska es un formidable perro nórdico, con cientos de años de historia, originario del Ártico y emparentado con el Husky Siberiano. Criados por la tribu inuit de Alaska, los Malamute destacan por su extraordianria potencia y fortaleza física.'),
(7, 'American Bully', 'Los perros American Bully, Bullypit o American Bullypit tienen su origen en la década de los años 80 del cruce entre las razas American Pitbull Terrier y Amstaff. Son grandes perros de compañía creados para tener un aspecto imponente, pero con un carácter dócil y bonachón.'),
(8, 'Amstaff', 'El Amstaff Staffordshire Terrier Americano o American Staffordshire Terrier proviene de cruces ocurridos en Gran Bretaña entre antiguos perros Bulldog ingleses y viejos Terriers ingleses. Fuerte y musculoso, fue concebido como un perro de pelea. Se encuentra catalogado como PPP.'),
(9, 'Barbet', 'El Barbet o Perro de Agua Francés, es una raza de tamaño mediano y pelo lanoso y rizado, clasificada dentro de los perros de agua. Es el perro de familia por excelencia, ya que son ágiles, activos, inteligentes, alegres, obedientes y muy pacientes con los niños.'),
(10, 'Basset Hound', 'Sí, has acertado, el famoso perro de rastreator es un Basset Hound. Estos sabuesos de orejas grandes poseen uno de los olfatos más prodigiosos de todas las razas de perros. Además, su bajo porte les hace infalible a la hora de seguir el rastro de sus presas.'),
(11, 'Beagle', 'Sabuesos de gran olfato, los Beagle eran usados en la caza, pero su carácter dócil, amoroso y delicado, hace que sean un perro de familia perfecto. De carácter muy afable, les encanta estar en familia y participar de la vida doméstica. Además, son especialmente pacientes con los niños.'),
(12, 'Bichón Frisé', 'El Bichón Frisé también conocido como Bichón de Pelo Rizado o Bichon a Poil Frisé. De pelo blanco, largo y tirabuzonado, destaca por tener un carácter alegre y activo, sin llegar a ser nervioso. Un perro de compañía ideal que, además, se adapta muy bien a la vida en apartamento.'),
(14, 'Bichón Habanero', 'El Bichón Habanero o Habanés, aunque de pelo menos rizado, comparte origen y características con los demás bichones. Llevado a Cuba por marineros españoles, es entre la aristocracia de la isla del s. XIX donde se vuelve muy popular. Casi extinto, se recuperó en EEUU en el s. XX.'),
(15, 'Bichón Maltés', 'El Bichón Maltés es un perro pequeño, de pelo largo, blanco y sedoso. Originario del Mediterráneo, toma su nombre de la isla de Malta. Perro antiguo que era usado para cazar ratones, hasta que por su carácter afable y vital, pronto, se convirtió en un excelente perro de compañía.'),
(16, 'Bobtail', 'El Bobtail o Viejo Pastor Inglés es un perro de gran tamaño y muy vital con una increíble melena. A pesar de su tamaño, su buen carácter hace que sea un perro ideal para convivir con con niños. Se le da tan bien eso de ‘pastorear niños’ que los ingleses lo llman el ‘perro nanny’.'),
(17, 'Bodeguero Andaluz', 'Es un perro de talla pequeña que no sobrepasa los 8 kilos. Se originó en Andalucía, y su tarea tradicional era controlar las plagas de roedores. Son perros activos, ágiles y muy rápidos. Su carácter es alerta, despierto, juguetón y cariñoso. Se llevan muy bien con los niños.'),
(18, 'Boerboel', 'El perro Boerboel es conocido también como African Boerboel o Mastín Sudafricano. Es un perro moloso de gran tamaño, con una apariencia impactante. Originario de Sudáfrica del cruce de muchas razas previas que destaca por ser muy inteligente y un gran perro guardián.'),
(19, 'Border Collie', 'El Border Collie es una de las razas de perros más populares del mundo. Originarios de las islas británicas, los Border Collie, usados desde hace siglos para guiar rebaños, son considerados como los mejores perros pastores. Destacan por su inteligencia, agilidad y sociabilidad.'),
(20, 'Boston Terrier', 'El Boston terrier es un perro de compañía pequeño con un aspecto peculiar. Originario de Estados Unidos, se le conoce como el “gentleman americano’ debido a su carácter equilibrado y gentil y al peculiar color de su pelaje, oscuro con manchas blancas, que recuerda a un smoking.'),
(21, 'Bóxer', 'El Deutscher Bóxer o, simplemente, perro Bóxer, es un perro moloso de origen alemán. Pensados como perros de trabajo, llegaron a ser usados en las guerras mundiales. Sin embargo, su carácter activo, juguetón y afable con los niños, le han convertido en un gran perro de familia.'),
(22, 'Boyero de Berna', 'El Boyero de Berna es un perro originario de Suiza usado en la alta montaña. Su pelaje y costitución están pensados para soportar el frío. De aspecto bonachón, que no te engañen sus grandes siestas, es un perro que necesita de una gran actividad física para mantenerse sano.'),
(23, 'Braco alemán de pelo corto', 'Originario de Alemania, es el perro de caza por excelencia. Pesa 30 kilos. Es versátil, con excelente olfato, gran resistencia física y una inteligencia por encima de la media. Además, tiene un porte de líneas finas, bello y elegante. Como compañía es tranquilo y muy leal a su dueño.'),
(24, 'Braco de Weimar', 'Al Braco de Weimar es un precioso perro de piel gris aterciopelada. Este aspecto le ha ganado el sobrenombre de ‘el fantasma gris’. De gran olfato, fueron usados como perros de caza. Decarácter sensible, juguetón e inteligente, no destaca por ser la raza de perro más obediente.'),
(25, 'Bull Terrier', 'Originarios de Inglaterra en el s. XIX, los Bull Terrier provienen de cruces entre Bull Dogs y Terrier. De complexión fuerte y atlética, son fácilmente reconocibles por su cabeza en forma de huevo ‘egg-shaped’. Los Bull Terrier son perros con carácter y mucha energía.'),
(26, 'Bull Terrier Miniatura', 'El Bull Terrier Miniatura es una variante del Bull Terrier, de hecho, son prácticamente iguales a excepción de que su tamaño y peso es, aproximadamente, la mitad. Podría pensarse que el minuatura es una evolución del estándaar, pero no, fué el miniatura el Bull Terrier original.'),
(27, 'Bulldog Francés', 'Llamados popularmente Frenchies, el Bulldog Francés es un perro de pequeño tamaño que se caracteriza por sus orejotas levantadas estilo Batman. Son perros de carácter apacible y juguetón, que raramente ladran y se adaptan muy a la vida de su dueño. Eso sí, cuidado que roncan'),
(28, 'Bulldog Inglés', 'Tan británico como 007, no se puede negar que el Bulldog Inglés es uno de los perros con mayor personalidad del mundo. De carácter relajado y sociable, son buenos perros de familia. Por su morfología tiende a tener problemas de salud que encarecen su factura de veterinario.'),
(29, 'Bullmastiff', 'Los Bullmastiff son de complexión muscolosa y muy grandes (hasta 70 kg). Guardianes por naturaleza, imponen respeto a primera vista. Cariñosos y familiares con los suyos, pueden resultar agresivos con los extraños por lo que son perros que requieren de una socialización adecuada.'),
(30, 'Cairn Terrier', 'Los Cairn Terrier no son muy conocidos, pero si te nombró a Totó, el perro del Mago de Oz, seguro que te viene a la cabeza. Originarios de Escocia, poseen un pelaje duro que los protege del agua. Resistentes, inteligentes y energéticos, son de las razas que viven más tiempo.'),
(31, 'Cane Corso', 'El Cane Corso o Mastín Italiano es un perro de tamaño grande, entorno a 50 kg. de peso. Su comportamiento valiente y estable es ideal como perro de guarda. Su origen está en el antiguo Imperio Romano. De tipo moloso, el Cane Corso era seleccionado por su fuerza física y fiereza.'),
(32, 'Caniche', 'Inteligentes, divertidos y vivarachos, los Caniches se caracterizan por su pelo lanudo y su extraordinaria capacidad de concentración que los hace muy hábiles en el entrenamiento. De origen muy antiguo, han pisado desde las cortes de los reyes europeos, hasta las carpas de circo.'),
(33, 'Carlino', 'El Carlino, Pug o Pug Carlino es un perro de origen milenario que se remonta a la corte de los emperadores chinos. A este pequeño de carácter juguetón le encanta echar largas siestas. Por su tamaño, se adpata muy bien a la vida de aprtamento. Y sí, los Pug roncan.'),
(34, 'Cavalier King Charles Spaniel', 'Pequeño de grandes orejas peludas, los Cavalier King Charles Spaniel son originales de Inglaterra. El rey Charles II los declaró mascota de Inglaterra en el s. XVII. De apariencia tierna, los Cavalier son alegres, sociables y curiosos; y unos magníficos perros de compañía.'),
(35, 'Chihuahua', 'Chihuahua o Chuhuahueño es la raza más pequeña del mundo, además de ser una de las más longevas y la más antigua de América. Son vivarachos, alegres y cariñosos. Por su tamaño se adaptan a cualquier tipo de vivienda. Pero pequeño, no significa débil, son perros muy resistentes.'),
(36, 'Chow Chow', 'Estos pequeños leoncitos son los Chow Chow, una de las razas de perros más antiguas que se conoce. De origen chino, los Chow Chow están emparentados con Samoyedos y Huskys y están especialmente indicados para climas frios. Una de sus curiosidades es su lengua azul.'),
(37, 'Cirneco del Etna', 'El aspecto del Cirneco del Etna es, probablemente, lo más parecido que exista al de los perros antiguos. De origen ancestral, es difícil ver a este pequeño podenco fuera de su Sicilia natal. En su origen, era perro de caza, pero hoy en día también es una mascota leal y cariñosa.'),
(38, 'Cocker Spaniel', 'El Cocker Spaniel Inglés destaca por su inteligencia, jovialidad y sociabilidad. Es un perro que vive muy apegado a su dueño por lo que necesita pasar tiempo con su familia. Sociable por naturaleza, es capaz de hacerse amigo de cualquier persona, incluso desconocidos.'),
(39, 'Corgi', 'Es el perro favorito de la reina Isabel II de Inglaterra. El Corgi Galés es un perrito pequeño de patas cortas y cuerpo recio. Creado para el trabajo de granja, es muy trabajador, inteligente y atento con su dueño, lo cual hace que sea un perro ideal para dueños primerizos.'),
(40, 'Crestado Chino', 'Uno de los perros más curiosos que existe, el Crestado Chino. Sólo tienen pelo en cabeza, orejas y cola, siendo ‘calvos’ en el resto del cuerpo. Tienen una complexión esbelta y elegante. Su carácter alegre, jovial y divertido los convierte en grandes perros de compañía.'),
(41, 'Dálmata', 'Sin duda 101 Dálmatas y Cruela Deville hacen que el Dálmata sea una de las razas más conocidas popularmente. Las motas negras sobre su pelaje blanco los hacen inconfundibles. Los Dálmatas son perros amistosos y muy activos que requieren de mucha actividad física.'),
(42, 'Dobérman', 'La Dóberman Pinscher es una raza surgida en Alemania con clara vocación de perro guardián. Pese a su aspecto fiero, son leales y amorosos con la socialización adecuada. Sus carácterísticas orejas puntiagudas no son naturales, si no fruto de un cirujía estética.'),
(43, 'Dogo Argentino', 'El Dogo Argentino se clasifica dentro de la categoría de mastines. Creado para la caza mayor es considerado como el mejor perro de presa del mundo. Con un adiestramiento y socialización adecuados de joven, el Dogo Argentino se convierte en un compañero fiel, leal y cariñoso.'),
(44, 'Dogo de Burdeos', 'El Dogo de Burdeos es un perro gigante, con un peso de unos 50 kg. y perteneciente a la familia de los mastines. De origen francés, es un excelente perro de guarda. A pesar de su envergadura, el Dogo de Burdeos es un gran perro de familia, paciente, tranquilo, cariñoso y leal.'),
(45, 'Fila Brasilero', 'Original de Brasil, el Fila Brasilero o Cao de Fila, surgió de cruces estre mastines y perros poderosos. En Brasil son adorados y existe un dicho que dice: ‘Ser fiel como un Fila’. Considerado como PPP, son leales, fuertes y calmados, aunque pueden ser excesivamente protectores.\r\n\r\n'),
(46, 'Fox Terrier', 'De origen inglés, los Fox Terrier se usaban antiguamente para la caza del zorro, de ahí su nombre. Perro pequeño, ágil, activo y de gran fortaleza física, necesita mantener una vida activa pues están llenos de energía. El Fox Terrier más popular del mundo es Milú, el perro de TinTin.'),
(47, 'Fox Terrier Toy', 'El Fox Terrier Toy o Miniatura es una variante del Fox Terrier estándar y comparte sus rasgos fundamentales. Su peso no supera los 3 kg. A pesar a su tamaño reducido, no se trata de un perro frágil y mantiene un aspecto atlético y esbelto; adaptándose bien a la vida en piso.'),
(48, 'Galgo Español', 'El Galgo Español es un lebrel de pelo corto, ligero, de aspecto atlético y endiabladamente rápido. Se tiene constancia que ya era criado por los romanos. El perro de la nobleza por excelencia, el Galgo Español posee un carácter sensible, delicado y suave.'),
(49, 'Galgo Italiano', 'También denominado Lebrel Italiano o Piccolo Lebrel Italiano, el Galgo Italiano es el galgo más pequeño del mundo que apenas llega a pesar 4 kg. De carácter sensible, dócil y obediente, son fáciles de adiestrar, aunque, como otros galgos, suelen ser reservados con los extraños.'),
(50, 'Golden Retriever', 'Grande, amistoso, juguetón, son las características que han convertido al Golden Retriever en uno de los perros más populares. También llamado ‘Cobrador Dorado’ por sus orígenes como perro de caza de aves en Escocia. Hoy en día, el Golden es el perro de familia por excelencia.'),
(51, 'Gran Danés', 'El Gran Danés es un gigante noble, tranquilo, amoroso y de comportamiento equilibrado. Pasa por ser uno de los perros más altos del mundo, hasta los 85 cm de altura con cerca de 90 kg, de peso. Pero, su gran tamaño le pasa facuta, pues es una de las razas con una vida más corta.'),
(52, 'Husky Siberiano', 'Criados para soportar temperaturas bajo cero y realizar grandes esfuerzos, los Huskys Siberianos se han adaptado a vivir entre nosotros. Su origen está en la tribu Chukchi de Rusia. Perros de extraordinaria vitalidad y energía, no son aptos para llevar vidas sedentarias.'),
(53, 'Jack Russel', 'Un pequeño perro, con auténtico carácter terrier. Los Russel son valientes, intrépidos, aventureros, muy inteligentes y afectuosos. Seguramente te sonarán por sus apariciones en la televisión, y es que por su carisma y su toque cómico a menudo aparecen en cine y publicidad.'),
(54, 'Kangal Turco', 'El Kangal Turco es un perro ancestral muy poco común que se encuentra en las zonas rurales de Turquía donde realiza labores de perro pastor. El Kangal Turco pasa por ser uno de los perros más fuertes y valientes del mundo. Son perros acostumbrados a una vida activa.'),
(55, 'Komondor', 'Una de las razas con un aspecto más peculiar. El Komondor es una gran perro originario de Hungría. Su pelaje atirazbuzonado que le da un aspecto como de fregona lo hace inconfundible. Pero no creas que el Komondor nace con rastas, si no que éstas se van formando con el tiempo.'),
(56, 'Labrador', 'El Labrador Retriever, Cobrador de Labrador o Perdiguero Labrador es la raza más común del mundo por número de ejemplares registrados. Y es que su carácter es inmejorable: inteligente, sociable, amable, paciente, obediente… Es difícil no enamorarse de ellos.'),
(57, 'Lhasa Apso', 'Los Lasha Apso son perros de tamaño pequeño y de pelo denso y largo que los hacen muy atractivos visualmente. Son originarios del Tibet, donde hacían de guardianes de monasterios. Allí se les conoce con el sobrenombre de ‘Abso Seng Kye – perro león centinela’ debido a su melena.'),
(58, 'Lobero Irlandés', 'El Lobero Irlandés, también conocido como Irish Wolfhound, es la raza de perros más alta del mundo. Su origen se remonta milenios atrás. Usados como perro de caza mayor por los antiguos celtas, eran animales venerados. A pesar de su tamaño los Loberos Irlandeses son muy rápidos.'),
(59, 'Lobo Checoslovaco', 'Si te gusta el aspecto de los lobos, el pero Lobo Checoslovaco te va a enamorar pues es la raza de perro con un look más parecido. De hecho, su descencendia del lobo es reciente, lo que no lo hace apto para cualquier dueño. Su mirada es de las más profundas en un perro.'),
(60, 'Lobo Herreño', 'Autóctono de la Isla del Hierro en las Islas Canarias, el Lobo Herrereño es una raza muy poco conocida para el gran público. Criado como perro pastor de cabras y ovejas, tiene un carácter tranquilo y equilibrado que hace que sea un excelente perro de compañía.'),
(61, 'Malinosis', 'Malinosis es una variedad de perro Pastor Belga. Por tanto, los Malinosis tienen su origen en el pastoreo de ovejas siendo perros muy inteligentes y activos. Les encantan los retos y sentirse útiles, por ello quizas se hayan convertido en el perro polícia por excelencia.'),
(62, 'Mastín del Pirineo', 'El Mastín del Pirineo es un moloso de montaña, criado en la Cordillera de los Pirineos, al norte de España. De gran peso y envergadura, está habituado a resistir las inclemencias del tiempo, especialmente adaptado al frío y al trabajo de pastoreo y guarda del ganado.'),
(63, 'Mastín Español', 'También conocido como Mastín Leonés o Mastín Ibérico, el Mastín Español es un perro fuerte, calmado, leal, trabajador y buen guarda. Características que históricamente le hicieron ser el mejor amigo del pastor para protegerse del lobo, los asaltantes y guiar el ganado.'),
(64, 'Mastín Inglés', 'El Mastín Inglés o Mastiff es considerado el perro más grande del mundo, al menos, el de mayor peso, siendo la ‘mole perruna’ por antonomasia. Puede alcanzar los 105 kg. Su origen es tan ancestral, que se dice que impresionaron al propio César durante su conquista de Britania.'),
(65, 'Mastín Tibetano', 'El Mastín Tibetano, o también llamado Dogo Tibetano, ostenta el título de perro más exclusivo de Asia. Como el resto de mastines, tiene su origen en el pastoreo y guarda de ganado. De carácter calmado, suave y majestuoso, llama la atención por su bonito manto de pelo.'),
(66, 'Pachón Navarro', 'Un perro con dos narices, así es el Pachón Navarro, Perdiguero Navarro o Pointer Español. Sus fosas nasales se encuentran divididas por un surco dando la apariencia de tener dos narices. Por esta característica, el Pachón Navarro es uno de los perros más raros del mundo.'),
(67, 'Papillón', 'De origén francés, su nombre, Papillón, significa mariposa en el idioma del país galo. Le dieron ese nombre ya que el pelaje largo de sus orejas le da un aspecto de alas de mariposa. El perro mariposa es pequeño, ágil, activo, cariñoso y uno de los considerados más bellos.'),
(68, 'Pastor Alemán', 'Por sus cualidades para el trabajo y su carácter sereno, este es uno de los perros más extendidos y queridos en todo el mundo. Son activos, inteligentes y excelentes guardianes. Necesitan ejercicio diario para mentenerse en buena forma física y mental. Pesan 35 kilos.'),
(69, 'Pastor Alemán Blanco', 'El pastor blanco suizo es una raza hermana del pastor alemán, pero completamente blanco, debido a un gen recesivo. Es mediano, atlético, ágil y bien formado. Pesan 32 kilos. Son algo más ligeros y menos robustos que el pastor alemán, tanto en peso como en apariencia.'),
(70, 'Pastor Australiano Miniatura', 'Bellísimo, marrón o gris merlé, a menudo con ojos azules. Ideal para familias activas, que vivan en el campo o tengan jardín, y personas solteras que amen hacer deporte o salir a paear con su perro. Pesa entre 9 y 18 kilos. Y bien socializado se lleva genial con los niños.'),
(71, 'Pastor Beaucerón', 'Una antigua raza rústica, poco conocida fuera de Francia, surgió en zonas rurales cercanas a París. Pesa 35 kilos. Es un perro inteligente, fuerte, valiente, noble, activo, ágil y de gran determinación. Fundamentalmente es un perro sensato y excelente perro guardián.'),
(72, 'Pastor Belga', 'La raza de perro pastor belga en realidad puede hacer referencia a 4 perros ligeramente diferentes, que se distinguen por la longitud y textura de su pelaje, y también por su carácter. Son extremadamente inteligentes, con un nivel de energía muy alto. No son aptos para cualquier dueño.'),
(73, 'Pastor de Brie', 'Originario de Francia, donde pastoreaba ovejas. Tamaño grande, pesa entorno a 30 kilos. Son activos, enérgicos y con carácter. A pesar de que son perros de trabajo, mucha gente encuentra su aspecto divertido, porque con su largo pelo y sus orejas erguidas parecen un peluche gigante.'),
(74, 'Pastor Caucásico', 'Es un gigante, que puede sobrepasar los 50 kilos. Es un perro con un alto coste en manutención, ya que necesita suficiente comida y espacio para su tamaño. Originario de Armenia, se empleaba para proteger los rebaños contra osos y lobos, como guardián y para defender fortalezas.'),
(75, 'Pastor de Asia Central', 'También llamado Alabai, es uno de los perros más imponentes que existen. Los machos sobrepasan los 70 kilos. Tradicionalmente son guardianes y pastores. Son valientes, equilibrados, pasan desapercibidos mientras trabajan, ya que no ladran ni corren. Son vigilantes, territoriales e inteligentes.'),
(76, 'Pastor Holandés', 'Inteligente, activo y resistente en extremo, esta raza surgió en Holanda, para pastoreara rebaños de ovejas en grandes campos. Este atleta no es apto para cualquier persona, ya que si no lo trabajan lo suficiente al aire libre, acabará siendo un perro hiperactivo en casa.'),
(77, 'Pastor Ovejero Australiano', 'El pastor australiano es un perro mediano, y pesa entre 14 y 30 kilos. Son famosos por su hermoso pelaje moteado, en tonos rojizos o grises. Algunos incluso tienen ojos azules. Otro de sus fuertes es su carácter; juguetón, vital, lleno de energía, y muy apegado a su dueño.'),
(78, 'Pekinés', 'El Pekines es una raza de escaso peso inferior a los 5 kilos, pelo muy largo, grandes ojos, hocico achatado y un carácter fuerte y dominante. Esta pequeña raza es de origen real, y es que su cría estaba reservada únicamente para la familia imperial o a la alta nobleza china.'),
(79, 'Pequeño Brabantino', 'Esta es una raza de perros belgas muy poco conocida, de tamaño diminuto y cabecitas redondeadas. Su pelo es corto, y su color negro o fuego. Su carácter despierto, inteligente, equilibrado y alegre. Suelen estar alerta, y son muy sensibles. No son perros agresivos, ni miedosos.'),
(80, 'Perdiguero de Drente', 'Es un perro de caza muy poco conocido, originario de la provincia de Drente, en Holanda. Es de tipo Spaniel, y se criaba como perro de caza. Es versátil y sirve tanto de mostrador como de cobrador. Es resistente y se adapta a llanuras, así como a terrenos pantanosos.'),
(81, 'Perdiguero Frisón Stabij', 'Es un perro de muestra, especialista en la caza de aves, que se originó en Frisia, al norte de Holanda. Pesa 23 kilos. Es un perro amable y positivo, pero requiere actividad física a diario, por eso está más adaptado a la vida en zonas rurales. Solo hay 3.500 ejemplares.'),
(82, 'Perro de Agua Español', 'Una de las razas estrella de origen español, y cada vez más extendida. Este perro de agua tiene un pelo particular, rizado, que tiende a formar rastas. Su personalidad es genial, tranquilos, sociables, juguetones y resistentes. Ideal para amantes de los paseos y del campo.'),
(83, 'Perro de Agua Frisón', 'Surgido en los Países Bajos, es una raza de tamaño mediano, alegre y juguetón, poco conocida fuera de su país de origen. Era empleado como perro de caza en zonas pantanosas, por lo que sigue siendo un perro activo y deportista. Son muy cariñosos en familia, e ideales para niños.'),
(84, 'Perro de Agua Portugués', 'Este perro mediano, tiene un llamativo pelo rizado u ondulado, color negro, blanco o marrón. Es una raza originada en la edad media, en Portugal, que solía trabajar con los pescadores. Hoy es un perfecto perro de compañía; amable, divertido, y fácil de educar.'),
(85, 'Perro de San Huberto', 'Esta raza de perros de tipo sabueso, podee un enorme tamaño, llegando hasta los 50 kilos. Son llamativas sus largas orejas y su pronunciado hocico, que le confiere una nariz prodigiosa. Su espacio ideal es una casa de campo, o con jardín donde pueda esparcirse y ejercitarse.'),
(86, 'Perro Sin Pelo del Perú', 'Son muy cariñosos y una excelente compañía para cualquier tipo de persona. El Perro sin pelo del Peru es uno de los más antiguos que existen. Su calvicie natural llamó la atención de los habitantes andinos preincaicos desde hace siglos. Llegaron a atribuirle un rol mágico.'),
(87, 'Pila Argentino', 'El Pila argentino es una pequeña raza de perros sin pelo, de piel suave, color oscuro y carácter dulce y despierto. Recuerda al Xoloitzcuintle pero su lomo es más corto. Por lo afectuosos que son, hacen mucha compañía, y gracias a su pequeño tamaño, son ideales para apartamentos.'),
(88, 'Pinscher', 'Oriundo de Alemania, el pequeño pinscher miniatura es un perro pequeñito, bien proporcionado, elegante y ligero. El pincher es activo, energético, juguetón, y muy resistente para su pequeña talla. Son además muy inteligentes y obediente, siempre atentos a su alrededor.'),
(89, 'Pitbull', 'El pitbull es un perro activo, sociable, energético, despierto, inteligente, participativo, muy leal, adora la vida en familia y protege mucho a los niños del hogar. Eso sí, necesita ser socializado y educado desde pequeño, para controlar su gran fuerza y potencia.'),
(90, 'Podenco', 'Es un perro muy activo, deportista e inteligente. Tienen un carácter bueno, y cero agresividad. Los podencos pertenecen a una antigua estirpe de perros cazadores cuya historia se pierde en el tiempo. Muy apreciados desde hace siglos para rastrear y cobrar liebres y conejos.'),
(91, 'Pointer', 'Para muchos, el pointer es una de las mejores razas del mundo. Sensatos, obedientes, ágiles, buenos compañeros para ir a pasear, y enamorados de su dueño. Si te gustan los perros grandes, caminar o hacer deporte, y dejarte querer por una raza dulce y cariñosa, este es tu perro.'),
(92, 'Pomerania', 'Impresionan por su pequeño tamaño, su cuerpo bien proporcionado y su precioso pelo largo y abundante, que los hace parecer lobitos en miniatura. Estos perros son originarios de Alemania y detrás de sus orgullosos andares, se esconde un leal amigo que te seguirá a todas partes.'),
(93, 'Presa Canario', 'Es un can español tamaño gigante, de tipo molosoide. En su origen, se cruzaron antiguas razas para obtener un perro que combinase la talla y fuerza de los dogos, con la agilidad, y el nervio de los perros pastores rústicos. Es sosegado, seguro de sí mismo y excelente guardián.'),
(94, 'Ratón de Praga', 'El perro de menor alzada del mundo, solo pesa entre 1,5 y 3,5 kilos. Es ligero y estilizado, bien proporcionado. De color negro con fuego, su pelo es corto, lustroso y muy brillante. Ideal para vivir en ciudades y apartamentos pequeños, su esperanza de vida es de 12 a 14 años.'),
(95, 'Rottweiler', 'Estos perros alemanes, surgieron hace siglos para pastorear y manejar ganado bovino y eran el perro más habitual entre los carniceros. La raza rottweiler posee una extraordinaria fuerza y potencia, pero también nobleza y obediencia. Es extremadamente inteligente, leal y cariñoso.'),
(96, 'Samoyedo', 'Es un perro mediano, en torno a los 25 kilos. De estructura compacta y armoniosa, lo más bonito es su manto de pelo blanco y semilargo, muy tupido para protegerlo del frío ártico. Según recientes estudios de ADN, constituye una de la razas más antiguas del mundo.'),
(97, 'San Bernardo', 'El más famoso delos perros gigantes. La rmajestuosa raza San Bernardo es originaria de los Alpes suizos. Su estampa más tradicional es verlos en la nieve, con su barril de Brandy al cuello. Son perros bonachones, tranquilos y seguros. Solo aptos para casas grandes, y con jardín.'),
(98, 'Schnauzer', 'Este barba azul de origen alemán, es todo un personaje de bigotes plateados que ha sabido ganarnos con su arrolladora personalidad. Amistosos, divertidos, activos y determinados. Podemos encontrarlos en diferentes tamaños, desde el Schnauzer gigante hasta el miniatura.'),
(99, 'Setter Gordon', 'La raza de perros setter gordon tiene su origen como antiguo perro de caza en Escocia. Inteligente, ágil y trabajador, uno de sus rasgos más llamativos es su precioso pelaje negro brillante, con manchas color fuego. Deben su nombre al cuarto Duque de Gordon, quien los criaba.'),
(100, 'Setter Inglés', 'El setter inglés es un hermoso perro de pelo largo y manchas negras y blancas, que en origen surgió como perro cazador, dentro de los llamados perros de muestra. Su pelaje es largo, suave, sedoso y ligeramente ondulado. Existen en 4 colores, y no superan los 30 kilos.'),
(101, 'Setter Irlandés', 'Activo, duro, saludable e inteligente. Muy vigoroso y apto para el trabajo en el campo. Su historia está ligada a la caza, y descienden de perros setter tradicionales. En el siglo diecinueve, se introdujo en este linaje un perro de color rojo sólido y extraordinaria belleza.'),
(102, 'Shar Pei', 'El perro shar pei es leal, divertido y juguetón, pero a ratos es bastante independiente y algo cabezota, capaz de llevar a cabo sus propias ideas. Al igual que el Chow-chow es de origen chino, y su lengua es azul. De tamaño grande, pesa entre 20 y 30 kilos.'),
(103, 'Shiba Inu', 'Se trata de un perrito de tamaño pequeño, manto muy peludo, y que casi no ladra. El Shiba Inu es un perro asiático, de hecho, es la más pequeña de las razas japonesas. Son perros cariñosos, independientes, de gran personalidad, juguetones, y activos. Pueden entrenarse fácilmente.'),
(104, 'Shi-Tzu', 'El shih tzu es una raza de perros muy extendida y apreciada. Provienen de China, y son famosos por su largo y sedoso pelo, y por su típica cara redonda, que recuerda a la flor del crisantemo. Son de tamaño pequeño, ya su peso oscila entre los 4,5 y los 8 kilos.'),
(105, 'Spaniel Japonés', 'El Spaniel japonés o chin es una raza de perro patrocinada por Japón, pero de origen Chino. Es realmente pequeño, ya que su peso oscila entre los 3 y los 5 kilos. Lo más llamativo es su peludo manto y sus orejas colgantes con flecos. Son perritos alegres, juguetones y vivarachos.'),
(106, 'Spitz Finlandés', 'Un pequeño perro de pelo largo, aspecto menudo, armonioso y muy peludo, adaptado vivir en las frías temperaturas del norte de Europa. Son activos, resistentes, fuertes, sanos, y tienen muy pocos problemas de salud. De hecho, es uno de los perros con menos gasto en veterinarios.'),
(107, 'Springer Spaniel', 'El Springer spaniel inglés es una raza de perro de orejas colgantes, y talla mediana, aspecto compacto y elegante, con un remoto pasado, ya que provienen de perros de caza medievales llevados desde España al Reino Unido. Es un perro fuerte, compacto, esbelto, vivaracho y activo.'),
(108, 'Stafforshire Bull Terrier', 'El Staffordshire e Staffy tiene su origen en las islas británicas, mediante de cruces entre el antiguo bulldog inglés y perros de raza terrier, que buscaban obtener un perro potente tenaz, energético y activo. Son perros medianos, que poseeen una gran fuerza para su tamaño.'),
(109, 'Teckel', 'El Dachshund o teckel es una raza originaria de Alemania. También conocido como “perro salchicha” por la forma de su cuepo, tiene patas cortas, un tronco muy alargado y lindas orejas colgantes. El Dachshund existe en 3 variedades de pelaje; pelo corto, largo y pelo duro.'),
(110, 'Terranova', 'Negro, enorme, peludo e inteligente. La marca de la casa de la raza de perro Terranova es su carácter dulce y bueno, su suavidad, y su gran corazón. Esto, combinado con su capacidad de trabajo y su entrega, hacen que para muchos, el terranova sea la mejor de las razas gigantes.'),
(111, 'Tigre Andino', 'La raza de perro Tigre andino de doble nariz es un curioso animal de aspecto inusual, originario de Bolivia. Poco extendido y desconocido para el gran público, esta raza tiene una clara división entre ambos orificios nasales, y cada “nariz” puede moverse de forma independiente.'),
(112, 'Tosa Inu', 'El Tosa Inu o dogo japonés está clasificado por la Federación Cinológica Internacional en la categoría 2 (perros molosos dogo). Fue creado en el siglo diecinueve para lograr un perro más rudo y musculado que los perros japoneses tradicionales, cruzándolos con razas occidentales.'),
(113, 'Villano de las Encartaciones', 'El Villano de las Encartaciones o de Carranza es una raza de perros surgida en zonas rurales, al norte de España. Este bonito perro atigrado, se empleaba en el pastoreo de ganado bovino en el monte. Por ello son perros trabajadores, resistentes, activos, dóciles y fieles.'),
(114, 'Westie', 'El West Highland White Terrier o Westie es un perro pequeño, blanquito y muy amistoso. Fue criado como cazador de zorros, pero en la actualidad es una de las mejores mascotas que existen. Es muy sociable y cariñoso, por eso es ideal para familias y se lleva muy bien con los niños .'),
(115, 'Whippet', 'El Whippet es una raza de perro surgido en las islas británicas, similar a un galgo en miniatura. De pelo corto, su cuerpo es fino, esbelto y elegante. Tal vez el nombre de «Whippet» provenga de la palabra «whip» (látigo), debido al carácter despierto, vivo y rápido de la raza.'),
(116, 'Xoloitzcuintle', 'Es un perro sin pelo, con la piel oscura y arrugadita, de origen mexicano. Es este aspecto particular y negruzco que tiene, el que dió origen a su nombre, que deriva de “Xolotl”, el antiguo dios mexicano del inframundo y del fuego.'),
(117, 'Yorkshire Terrier', 'El Yorkshire Terrier proviene de Inglaterra. Es una de las razas de perros más pupulares en todo el mundo, y junto con el Chihuahua son los perros de menor tamaño que existen. Este pequeñín de pelo largo es refinado pero atrevido, y no dudará en ladrar a los perros más grandes.'),
(118, 'Maine Coon', 'El Maine Coon es sin duda una de las razas de gatos grandes. Detrás de su imponente aspecto, hay un gato tranquilo y cariñoso.'),
(119, 'Gato Savannah', 'El gato Savannah es una hermosa raza de gato muy alto. Con un temperamento de gato doméstico y un aspecto salvaje, heredado de su ancestro el serval africano (felino salvaje).'),
(120, 'Bosque de Noruega', 'El bosque de Noruega proviene de los países Escandinavos, específicamente de Noruega. Aunque no hay una teoría concreta de su origen, se cree que resulta del cruce entre gatos ancestrales del sur de Europa y gatos de pelo largo.'),
(121, 'Siberiano', 'Esta raza como su nombre lo indica es proveniente de Siberia. Una vasta región que está ubicada en la parte asiática oriental de Rusia.'),
(122, 'Gato Ragdoll', 'El gato Ragdoll, es el resultado de un cruce entre una gata de Angora y un gato sagrado de Birmania. Es un gato reconocido por tener un carácter peculiar.'),
(123, 'British Shorthair', 'Los gatos de raza British Shorthair o gatos Británicos de Pelo Corto son famosos y reconocidos a nivel mundial por ser la raza del peculiar gato que aparece en la historia de Alicia en el país de las maravillas.\r\n\r\nOriginario de Inglaterra, el gato British Shorthair ha encantado a miles de ingleses durante años, ya que ha sido una de las razas favoritas y más apreciadas por todos los hogares debido a su interesante físico y su peculiar carácter.'),
(124, 'Sagrado de Birmania', 'El gato de sagrado de Birmania o gato Birmano, es una hermosa raza de felinos caracterizada por ser una versión del gato Siamés, pero con melena larga y principalmente por tener las puntitas de las patas, blancas.'),
(125, 'Angora Turco', 'El Gato Angora, son gatos especialmente cariñosos y que conviven muy bien con las familias. Con una personalidad caracterizada por ser sociables, juguetones e inteligentes.'),
(126, 'Gato Persa', 'Cuando pensamos en el gato Persa, nos viene a la mente ese aire de elegancia y distinción que emana de manera natural. Son gatos con un porte especial, distinguido quizá, altivo a veces, pero nunca nos va a dejar indiferentes. '),
(127, 'Siamés', 'Todos reconocemos en seguida a un gato Siamés. Ese porte elegante, su patrón pointed, tan característico y sus ojos de un azul intenso, pero su historia se remonta a Asía al menos hace 500 años.'),
(128, 'Bengalí', 'El gato bengalí o de bengala, es como un leopardo o un tigre en miniatura, con el espíritu salvaje de estos, pero con la calma, cercanía y cariño que puede darte un gato doméstico.'),
(129, 'Gato Exótico', 'El gato exótico es una raza muy parecida al gato persa, pero a pesar de mantener muchas de sus características ya que proviene de un cruce entre el British Shorthair y un gato Persa.'),
(130, 'Azul Ruso', 'El azul Ruso es una raza de gato fácil de distinguir entre otras razas. Particularmente por el tono plata de su pelaje. Son gatos de pelo corto y tamaño mediano. Fueron traídos a Europa del Norte en 1860.'),
(131, 'Nebelung', 'El gato Nibelungo o Nebelung, tiene las orejas de base ancha y las puntas ligeramente redondeadas, su cuerpo es estilizado y es un gato muy ágil y musculoso.'),
(132, 'Gato Himalayo', 'El gato Himalayo tienen una apariencia física similar a la del gato Persa y la del gato siamés, de hecho fue el resultado de un cruce entre estas dos razas.'),
(133, 'Van Turco', 'El Gato Van Turco es originario del lago van al sureste de Turquía, específicamente en la altiplanicie de Armenia. Sin embargo la historia de cómo surgió esta raza desde hace cientos de años se remonta a una curiosa leyenda.'),
(134, 'Gato Oriental', 'El gato Oriental es un gran desconocido, pero es reconocible a simple vista, por tener diferentes rasgos, a los gatos comunes. Su cara afilada y larga, con unas orejas grandes y abiertas, un cuerpo bonito y alargado y una astucia increíbles.'),
(135, 'Sphynx o Gato Esfinge', 'Exótico, raro, bello, extraño… hasta con pinta de alienígena han llegado a definir a esta raza gatuna que se caracteriza por la «ausencia» de pelo. El gato Sphynx o Esfinge produce fascinación y curiosidad.'),
(136, 'PeterBald', 'Aunque su complexión y aspecto los pueden relacionar con el aspecto de la piel de un gato Sphynx y la complexión y figura de un gato oriental de pelo corto, el Peterbald es por si misma, una raza propia.'),
(137, 'Lykoi', 'Los gatos Lykoi son también llamados gatos lobo, por su físico tan similar al de un pequeño lobo, donde su pelaje y sus ojos son los caracteres que los hacen tan peculiares. '),
(138, 'Munchkin', 'La raza de gatos Munchkin se caracteriza por ser de tamaño pequeño o mediano y por tener las patas cortas, pero el torso y la cola de tamaño normal, por esto son considerados como gatos que no crecen.'),
(139, 'Burmés', 'El gato Burmés es una raza de felino que no te dejará indiferente. Así se explica cómo desde sus orígenes remotos acabó expandiéndose a todos los continentes, especialmente a América, a principios del siglo XX.'),
(140, 'Curl Americano', 'Existe un gato que tiene las orejas enroscadas, que le dan un aire gracioso y tierno, y no es otro que el gato Curl americano. ¿Por qué tiene las orejas así?'),
(141, 'Scottish Fold', 'Los gatos Scottish Fold son originarios de Escocia y surgen a partir de una mutación genética que se dio en la primera gata Scottish Fold llamada Suzie.'),
(142, 'Burmilla', 'El gato Burmilla no es uno de los más conocidos. Como amante de estos felinos, estamos seguros de que te va a interesar conocer las peculiaridades que lo hacen especial.'),
(143, 'Abisinio', 'El Abisinio es un gato muy especial. Se trata de un animal de una gran inteligencia y con una condición física excepcional, al que le encanta escalar, saltar, correr y en general mantenerse activo. Tiene espíritu de aventurero y explorador, sin duda.\r\nQuédate con nosotros y te hablaremos sobre los gatos Abisinios, para que lo conozcas un poquito más, su carácter, cuidado y además te contaremos algunos datos curiosos sobre ellos.'),
(144, 'Gato Bombay', 'El gato Bombay es un gato especialmente tranquilo y sociable, que se adapta bien a los diferentes entornos y vida familiar y al que le encanta seguir allá donde vayan sus humanos. Pero vamos a contarte más cosas interesantes de el, como su origen, carácter, cuidados y curiosidades y por qué es un gato distinto en algunos aspectos,  al resto de sus congéneres.'),
(145, 'Korat', 'Ya aparecen en el poema de los libros de los gatos, antiguo escrito tailandés, y en ellos se habla del si-sawat de color plata azulado y distinto de otros gatos azules. Conócelo.'),
(146, 'Bobtail Japonés', 'Aunque hoy en día, sea una raza extendida por todo el mundo, el bobtail gato es una especie autóctona de Asia. De hecho, comparte rasgos físicos con otras especies de gatos de estos orígenes. '),
(147, 'Gato Balinés', 'El gato Balinés tiene un origen especial, pues no está claro que una de sus característica especial como es el pelo largo, haya estado presente en el gato siamés, del que procede.'),
(148, 'Singapura', 'El Singapura es un gato fascinante, con un carácter y curiosidades, que lo hacen únicos a otros gatos. Ven a conocer al gato de Singapur.'),
(149, 'Laperm', 'El Laperm es un gato poco conocido. Hablamos de su origen, carácter, características y si es hipoalergénico. Conócelo con fotos y la mejor información.'),
(150, 'Devon Rex', 'Se dice que es posiblemente uno de los gatos más inteligentes que pueda haber. Por eso les apasionan los juguetes de tipo rompecabezas.'),
(151, 'Cornish Rex', 'El origen del gato Cornish Rex nos lleva al año 1950, en una granja de Bodmin, en Cornualles (Inglaterra). Allí apareció un gatito con el pelo rizado, en un camada de una gata asilvestrada que vivía muy cerca.'),
(152, 'Selkirk Rex', 'El gato Selkirk Rex, es un gato de pelo rizado, originario de Estados Unidos en 1987, cuando tuvo lugar un hecho muy particular, en un refugio de animales, en Sheridan, Montana.'),
(153, 'Gato Común Europeo', 'También es conocido como gato callejero o gato romano. Es el gato más común en muchos hogares, inteligente, fuerte y sociable. Ven a conocerlos mejor.'),
(154, 'Snowshoe', 'El gato Snowshoe tiene su aparición en 1960, en EstadosUnidos, cuando la Criadora Dorothy Hinds, decide recuperar una peculiaridad de los primeros gatos siameses.'),
(155, 'Gato Cartujo', 'El Gato Cartujo o Chartreux siendo nativo de Turquía e Irán es posiblemente una de las más antiguas razas de gatos que existen.'),
(156, 'Mau Egipcio', 'El Mau Egipcio, es una de las razas más antiguas del mundo. Sepamos más de este gato tan desconocido, como especial. '),
(157, 'Ocicat', 'El gato Ocicat es un gran desconocido en el mundo de las razas de los gatos. Es un gato aventurero, maullador y hablador, muy inteligente y al que le encanta la exploración.'),
(158, 'Toyger', 'El origen de este gato tan especial se debe a Judy Sugden, que quiso crear una raza de gatos que emulara al gran tigre de la India, allá por la mitad de la década de los 80, en Estados Unidos.'),
(159, 'Gato Manx', 'El gato Manx, fue presentado en sociedad por primera vez en el año 1860, en los primeros concursos felinos y tuvo gran éxito, por su inusual característica y por un carácter muy especial.'),
(160, 'Mestizo', 'La raza de la mascota no está definida'),
(161, 'Maltes', NULL);
